import React from 'react'
import styled from 'styled-components'

export const TextButton = (props) => {
    const {onClick, children} = props
    return (
        <Button href={onClick}>{children}</Button>
    )
}

const Button = styled.a`
    color: #2655ac;
    font-size: 18px;
`
